import { withAreaConsumer } from "../../context";
import AreasList from "../areas-list";
import AreasContainer from "./index";

function AreaContainer({ context }) {
  const { areas } = context;
  return (
    <>
        <div className="container">
            <AreasList areas={areas} 
                       are={this.term(filteredAreas)}
                       handleAreaView={this.handleAreaView}
                       inputFilterOnchange={this.inputFilterOnchange}
                       inputValue={this.state.inputValue} />
        </div>
    </>
  );
}

export default withAreaConsumer(AreaContainer);
